import React from 'react';
import { Link } from 'react-router-dom';

class NavItem extends React.Component {
  defaults = {
    liClassName: "navbar__item",
    linkClassName: "navbar__link",
  } 
  render() {
    const { onMouseEnter, to, label } = this.props;
    return (
      <li onMouseEnter={onMouseEnter} className={this.defaults.lclassName}>
        <Link className={this.defaults.linkClassName} to={to}>{label}</Link>
      </li>
    );
  }
}


export default NavItem;
